      | 3633 -> { ItemTypeData.id= 3633; name= "Amarr Magnate Frigate"; published= false; description= "This Magnate-class frigate is one of the most decoratively designed ship classes in the Amarr Empire, considered to be a pet project for a small, elite group of royal ship engineers for over a decade. The frigate's design has gone through several stages over the past decade, and new models of the Magnate appear every few years. The most recent versions of this ship – the Silver Magnate and the Gold Magnate – debuted as rewards in the Amarr Championships in YC105, though the original Magnate design is still a popular choice among Amarr pilots."; marketGroupId= None; groupId= 226; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 9; value= 100000000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 32.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(3367); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 32.000000; volume= 0.000000 } |> Some
      | 363309 -> { ItemTypeData.id= 363309; name= "Militia Forge Gun"; published= false; description= "Adapted from Deep Core Mining Inc.'s proprietary technology, the DCMA S-1 subverts conventional expectations of what a man-portable anti-material weapons platform is capable of. Despite its excessive weight and extended recharge time, the “Forge Gun” as it has become known, is regarded as the most devastating infantry weapon on the battlefield, and an invaluable tool for those capable of wielding it.    Powered by a Gemini microcapacitor, the forge gun utilizes a stored electric charge to fire kinetic slugs at speeds in excess of 7,000 m/s, enough to penetrate even augmented armor systems. During the pre-fire charge, the forward armature locks into position, stabilizing the magnetic field and helping to shield the user from backscatter and the excessive heat produced.  Power generation remains the single largest drawback of the current design, the onboard capacitor requiring a significant amount of time to reach full power after each discharge. "; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
