      | 36516 -> { ItemTypeData.id= 36516; name= "Women's 'Hephaestus' Shoes (gray/orange)"; published= true; description= "Designer: Vallou Outerwear  When Outer Ring Excavations was looking to update and modernize their crew uniforms, they relied on Vallou Outerwear to take on the challenge. Vallou upper management was so impressed with the result, they commissioned a limited range of custom variants, known as the “Hephaestus” collection.   These functional but high tech shoes retain the utilitarian look of the original uniforms, but with much higher material quality and attention to detail. Each pair of shoes are crafted from gray and orange materials and fabrics that are extremely durable yet comfortable enough to wear for extended periods."; marketGroupId= Some(1404); groupId= 1091; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 1773; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 365443 -> { ItemTypeData.id= 365443; name= "BK-42 Assault Combat Rifle"; published= false; description= "A gas-operated, short-barreled weapon, the combat rifle is a semi-automatic weapon well-suited to both short and medium range combat. Classified as a light support weapon, it is typically employed in target-rich environments where the high volume of fire produced enables operators to engage multiple targets in rapid succession, whilst the weapon’s extended range keeps the operator just beyond the threat threshold of most standard assault rifles.    Its advanced bullpup configuration reduces weapon weight and improves maneuverability making it the ideal cross-over weapon for urban and field combat. The modular design has more practical advantages as well in that it’s cheap to maintain and easily replaced if damaged, making it one of the most reliable weapons in service today."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365928 -> { ItemTypeData.id= 365928; name= "'Flying Scotsman' Assault ck.0"; published= false; description= "NOTE: In addition to pre-requisite skills, this pre-fitted dropsuit requires PG/CPU optimization skills to be trained in order to be used.    The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.    A flat-coil e5000 fifth generation fusion core runs up the inside of the back plate, powering the entire suit. Its output and heat buildup are controlled by a L2 “Gatekeeper” regulator conduit, which connects directly to the sensor system at the base of the neck. Every joint is reinforced with kinetic sensors and two-way, high torque servos to enhance the soldier’s strength, balance, and resistance to impact forces. The suit’s helmet has more integrated sensor, communication, targeting, and data processing systems than most civilian vehicles. As is common with Caldari designs, armor plating is limited to vital areas, relying instead on high-power shield systems to protect the wearer.    Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
